import React from 'react';
import '../../Assets/style/style.css';
const About = () => {
    return (
        <section id="about">
            <div class="container flex">
                <div class="header " data-animation="slide-in-left">
                    ABOUT
                    <div
                        class="header-bar "
                        data-animation="slide-in-left"
                        data-delay=".5s"
                    ></div>
                </div>
            </div>
        </section>
    );
};

export default About;
